import React from 'react';
import styles from './granite.css';

const granite = [
  {
    image: 'baltic_brown.jpg',
    title: 'Baltic Brown',
    description: 'Description for Stone Product 1.',
  },
  {
    image: 'blackgalaxy.jpg',
    title: 'Black Galaxy',
    description: 'Description for Stone Product 2.',
  },
  {
    image: 'blackgranite.jpg',
    title: 'Black Granite',
    description: 'Description for Stone Product 3.',
  },
  {
    image: 'bluepearl.jpg',
    title: 'Blue Pearl',
    description: 'Description for Stone Product 4.',
  },
  {
    image: 'brownpearl.jpg',
    title: 'Brown Pearl',
    description: 'Description for Stone Product 5.',
  },
  {
    image: 'camelbrown.jpg',
    title: 'Camel Brown',
    description: 'Description for Stone Product 6.',
  },
  {
    image: 'lavendergrey.jpg',
    title: 'Lavender Grey',
    description: 'Description for Stone Product 7.',
  },
  {
    image: 'tropicalgrey.jpg',
    title: 'Tropical Grey',
    description: 'Description for Stone Product 8.',
  },
  // Add more stone products as needed
];
function Granite() {
  return (
    <section className={styles['stone-products']}>
      <div className="container">
        <div className="row">
          {granite.map((product, index) => (
            <div key={index} className="col-lg-4 col-md-6 mb-4"> {/* Adjust column width for responsiveness */}
              <div className={styles['product-card']}>
                <img src={product.image} alt={product.title} className={styles['stone-img']} />
                <div className={styles['product-details']}>
                  <h2 className={styles['stone-title']}>{product.title}</h2>
                  <p className={styles['stone-description']}>{product.description}</p>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}

export default Granite;
